import React from 'react';
import './App.css';
import {Component} from "react";

class NewComponent extends Component {
    thing(num) {
        return num + 1;
    }
    render() {
        return (
            <div>
                <h1>Hello, world!</h1>
            </div>
        );
    }
}


function Counter() {
    const [count, setCount] = React.useState(0);
    return (
        <div>
            <button onClick={() => setCount(count - 1)}>
                -
            </button>
            <p>You clicked {count} times</p>
            <button onClick={() => setCount(count + 1)}>
                +
            </button>
        </div>
    );
}

function Cart() {
    return null;
}

function NavBar() {
    return (
        <div className="NavBar">
            <a href="https://www.buckeyecandycompany.com">Home</a>
            <a href="https://www.buckeyecandycompany.com/about">About</a>
            <a href="https://www.buckeyecandycompany.com/contact">Contact</a>
        </div>
    );
}

function App() {
  return (
    <div className="App">
        <NavBar/>
        <header className="App-header">
            <img src="http://www.buckeyecandycompany.com/img/BuckeyeCandyCompany.svg" className="App-logo" alt="logo"/>
            <p>
                Edit <code>src/App.js</code> and save to reload.
            </p>
            <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
            >
                Learn React
            </a>
        </header>
        <Counter/>
        <NewComponent/>
    </div>
  );
}

export default App;
